INSERT INTO `auditcomment` VALUES (1,'330681199309190024','2018-06-12 16:06:24','通过'),(2,'330681199312111016','2018-06-12 16:11:44','单位性质填私企、国企、民办非企业、机关事业单位等；学士不是职称。'),(3,'330681199501244432','2018-06-12 16:14:09','劳动合同期限未满一年。'),(4,'330621199509044658','2018-06-12 16:15:08','引进时间以在诸暨缴纳职工基本养老保险时间为准，请重新确认并再次提交。'),(5,'429001199402055914','2018-06-12 16:15:41','引进时间以在诸暨缴纳职工基本养老保险时间为准，请重新确认后再次提交。'),(6,'330681199505155445','2018-06-12 16:16:26',' 缺毕业证书；引进时间以在诸暨缴纳职工基本养老保险时间为准；单位性质填私企、国企、机关事业单位、民办非企业等；请再次核实后重新提交。'),(7,'362326199501030916','2018-06-12 16:17:22','头像照片能摆正吗？'),(8,'330681199404153301','2018-06-12 16:17:57','单位性质填私企、国企、民办非企业、机关事业单位……'),(9,'411627199201293382','2018-06-12 16:19:47','劳动合同即将期满，请提供新的劳动合同；简历栏请附上当前公司。'),(10,'330681199410202392','2018-06-12 16:20:13',' 身份证照片不清晰；单位性质填私企、国企等；'),(11,'330802199503103612','2018-06-12 16:20:40','头像照请上传2寸照；引进时间以在诸暨缴纳职工基本养老保险时间为准；劳动合同已到期，请提供新的劳动合同；学士不是职称；单位性质填私国企、民办非企业、机关事业单位……'),(12,'330681199302012938','2018-06-12 16:21:08','电子单证师不是职称，单位性质请填私企、国企、民办非企业等。'),(13,'330382199510015324','2018-06-12 16:21:45','单位性质填私企、国企、民办非企业、机关事业单位……'),(14,'330681199411185889','2018-06-12 16:21:45',' 请提交工作简历。'),(15,'330681199412100314','2018-06-12 16:22:19','引进时间以毕业后在诸暨缴纳职工基本养老保险时间为准，请确认后提交。'),(16,'330681199404081563','2018-06-12 16:22:31','引进时间以在诸暨缴纳职工基本养老保险时间为准；请提交劳动合同原件和身份证正反面照片；单位性质填私企、国企、事业单位等。'),(17,'330681199305242050','2018-06-12 16:22:50','你2018年3月社保中断一个月，请抓紧补缴，待补缴后重新提交。'),(18,'330681199502142358','2018-06-12 16:27:10','请确认用人单位名称，单位性质填国企、私企、民办非企业……科员非职称，若没有职称可填无。'),(19,'330681199106013896','2018-06-12 17:17:19','通过'),(20,'330681199410017066','2018-06-12 17:20:42','单位性质填私企、国企、个体工商户、民办非企业等。'),(21,'330681199503042367','2018-06-12 17:27:25','通过'),(22,'421181199408141354','2018-06-12 17:30:34','请核实用人单位名称。'),(23,'330681199503278740','2018-06-12 17:34:01','请提交身份证正反面，毕业证书学位证书；劳动合同一张一张拍；单位性质填民办非企业；用人单位填海亮外国语学校。'),(24,'330681199405272564','2018-06-12 17:39:07','单位性质填私企、国企、民办非企业等。'),(25,'330681199504128744','2018-06-12 17:41:18','单位性质填私企、国企、民办非企业等。'